import { useHistory } from "react-router-dom";
const Legends = () => {
return (
    <div className="legend">
        <h1 font={24} style={{marginTop:"-15rem"}}>Legenda începutului zborului</h1>
        <div>
            <p2 style={{marginTop:"5rem"}}>Icar este fiul lui Dedal, prezentat în mitologia greacă drept arhitect și sculptor, cel care a contribuit la ridicarea celebrului labirint din Knossos. În acest labirint regele Cretei, Minos, îl închisese pe Minotaur.</p2>
        </div>
    </div>

);
}
export default Legends;
